import React from "react";
import styles from "./CoordinatorDashboard.module.css";

const RightSidebar = () => {
  const recentContacts = [
    { name: "Samantha William", icon: "avatar1.png" },
    { name: "Tony Soap", icon: "avatar2.png" },
    { name: "Karen Hope", icon: "avatar3.png" },
    { name: "Jordan Nico", icon: "avatar4.png" },
    { name: "Nadila Adja", icon: "avatar5.png" },
  ];

  const messages = [
    { name: "Samantha William", time: "12:45 PM", message: "Lorem ipsum dolor sit amet." },
    { name: "Tony Soap", time: "12:45 PM", message: "Lorem ipsum dolor sit amet." },
    { name: "Jordan Nico", time: "12:45 PM", message: "Lorem ipsum dolor sit amet." },
    { name: "Nadila Adja", time: "12:45 PM", message: "Lorem ipsum dolor sit amet." },
  ];

  const fairs = [
    { title: "Lorem ipsum dolor sit amet.", icon: "fair1.png" },
    { title: "Lorem ipsum dolor sit amet.", icon: "fair2.png" },
    { title: "Lorem ipsum dolor sit amet.", icon: "fair3.png" },
  ];

  return (
    <div className={styles.rightSidebar}>
      {/* User Info */}
      <div className={styles.userInfo}>
        <div className={styles.userAvatar}></div>
        <h3 className={styles.userName}>Nabila A.</h3>
        <p className={styles.userRole}>Coordinator</p>
      </div>

      {/* Recent Contacts */}
      <div className={styles.sidebarSection}>
        <h4 className={styles.sectionTitle}>Recent Contacts</h4>
        <ul className={styles.contactsList}>
          {recentContacts.map((contact, index) => (
            <li key={index} className={styles.contactItem}>
              <div className={styles.contactAvatar}></div>
              <p>{contact.name}</p>
            </li>
          ))}
        </ul>
        <button className={styles.viewAllButton}>View All</button>
      </div>

      {/* Messages */}
      <div className={styles.sidebarSection}>
        <h4 className={styles.sectionTitle}>Messages</h4>
        <ul className={styles.messagesList}>
          {messages.map((msg, index) => (
            <li key={index} className={styles.messageItem}>
              <div className={styles.messageHeader}>
                <strong>{msg.name}</strong>
                <span className={styles.messageTime}>{msg.time}</span>
              </div>
              <p className={styles.messageContent}>{msg.message}</p>
            </li>
          ))}
        </ul>
        <button className={styles.viewAllButton}>View All</button>
      </div>

      {/* Upcoming Fairs */}
      <div className={styles.sidebarSection}>
        <h4 className={styles.sectionTitle}>Upcoming Fairs</h4>
        <ul className={styles.fairsList}>
          {fairs.map((fair, index) => (
            <li key={index} className={styles.fairItem}>
              <div className={styles.fairIcon}></div>
              <p>{fair.title}</p>
            </li>
          ))}
        </ul>
        <button className={styles.viewAllButton}>View All</button>
      </div>
    </div>
  );
};

export default RightSidebar;
